const solution = require("./solution");
const fs = require("fs");

function solutionTests(xml, workingXML){
    var assert = require('assert');
    //check that a valid XML doesn't throw any exceptions
    assert.doesNotThrow(() => {solution.parseXML(workingXML)})
    //check that valid XML without <CSVIntervalData> throws an error
    assert.throws(() => {solution.parseXML(xml[0])})

    //check condition that XML should have a "100" row as a header
    assert.throws(() => {solution.parseXML(xml[1])})

    //check condition that XML should have a "900" row as a trailer
    assert.throws(() => {solution.parseXML(xml[2])})

    //check condition that XML should have a "100" row as a header and "900" row as a trailer
    assert.throws(() => {solution.parseXML(xml[3])})

    //check condition that CSV Should be named after the second field in the "200" row
    assert.doesNotThrow(() => {
        solution.parseXML(workingXML)
        fs.exists('testFile1.csv', function (isExist) {
            if (!isExist) {
            throw 'File not created correctly'
            }
        });
        fs.exists('testFile2.csv', function (isExist) {
            if (!isExist) {
            throw 'File not created correctly'
            }
        });
    })
    //check condition that only Valid rows can start with "100". "200", "300", "900"
    //checks for missing '300,'
    assert.throws(() => {solution.parseXML(xml[4])})
    //checks for missing '300,' and first number being a number beginning with 300 (300000)
    assert.throws(() => {solution.parseXML(xml[5])})
    //checks for missing '200,'
    assert.throws(() => {solution.parseXML(xml[6])})
    //checks for missing '200,' and first number being a number beginning with 200 (200000)
    assert.throws(() => {solution.parseXML(xml[7])})

    //checks conditions that CSVIntervalData should contain 1 row for each of "100", "200", "300","900"
    //missing 100
    assert.throws(() => {solution.parseXML(xml[8])})
    //missing 200
    assert.throws(() => {solution.parseXML(xml[9])})
    //missing 300
    assert.throws(() => {solution.parseXML(xml[10])})
    //missing 900
    assert.throws(() => {solution.parseXML(xml[11])})

    //checks conditions that "100", "900" rows should only appear once inside the CSVIntervalData element
    //double 100
    assert.throws(() => {solution.parseXML(xml[12])})
    //double 900
    assert.throws(() => {solution.parseXML(xml[13])})

    //checks conditions that "200" and "300" can repeat and will be within the header and trailer rows 
    //repeated 200 and 300 already tested
    //test that 200 and 300 are between header and trailer rows
    assert.throws(() => {solution.parseXML(xml[14])})
    assert.throws(() => {solution.parseXML(xml[15])})

    //checks condition that "200" row must be followed by at least 1 "300" row
    assert.throws(() => {solution.parseXML(xml[16])})
}


